def subsample_df(x1, y1):
    case = y1.loc[y1.psych_hosp == 1]
    ctrl = y1.loc[y1.psych_hosp != 1]

    ctrl_sample = ctrl.sample(n=len(case))
    sub_df = case.append(ctrl_sample)
    sub_df_ = pd.merge(sub_df, x1, left_index=True, right_index=True)

    X_train = sub_df_.loc[:, sub_df_.columns != 'psych_hosp']
    y_train = sub_df_.loc[:, sub_df_.columns == 'psych_hosp']
    print('Subsampling Value Counts:\n', y_train.psych_hosp.value_counts(), '\n')

    return X_train, y_train

def cohort_id(df):
    df = pd.DataFrame(df['person_id'])
    # dx = pd.read_csv('/mnt/volume/data/depression_sdh/Joe_results/cdrn_all_individual_dx_1218.csv',encoding='utf-8', names=['person_id', 'condition_start_date', 'condition_source_value'])

    #goon server
    dx = pd.read_csv('/home/ubuntu/amir/depression_sdh/depression_sdh/Joe_results/cdrn_all_individual_dx_1218.csv',delimiter='\t',
                     encoding='utf-8', names=['person_id', 'condition_start_date', 'condition_source_value'])
    
    # dx = pd.read_csv('/Users/amir/code/joe/OMOP_Hospital_Predict/Joe_results/cdrn_all_individual_dx_1218.csv',encoding='utf-8', names=['person_id', 'condition_start_date', 'condition_source_value'])
    
    print('N records in cdrn_dx: {}'.format(len(dx)))
    print('N patients in cdrn_dx: {}\n'.format(dx.person_id.nunique()))

    missing_dx_hist = {'missing_dx': []}
    dx_hist_included = set(list(dx.person_id.values))
    for _ in df['person_id']:
        if _ in dx_hist_included:
            missing_dx_hist['missing_dx'].append(0)
        else:
            missing_dx_hist['missing_dx'].append(1)
    print('N patients in casecontrol missing dx history: {}\n'.format(missing_dx_hist['missing_dx'].count(1)))

    dx = df.merge(dx, on='person_id', how='inner')
    print('N records in cdrn_dx casecontrol: {}'.format(len(dx)))
    print('N patients in cdrn_dx casecontrol: {}\n'.format(dx.person_id.nunique()))

    return dx


