def load_word2vec_dic(model_name):
    '''
        A funcion for converting an embedding and return a dictionary
    '''

    print ('Loading word2vec into dictionary')
    print ('*******************************')
    embeddings_index = {}

    #we have to run it only once to save the model as txt file, Next time we only provide the txt location
    #model_name_txt = create_txt_from_bin(model_name)
    #sys.exit()
    model_name_txt = '/mnt/volume/data/embeddings/word2vec_twitter_model.bin_binary_false.txt'
    f = open(model_name_txt)
    #print f
    for line in tqdm(f):
        #print 'line--->',line
        #sys.exit()
        values = line.split()
        word = values[0]
        coefs = np.asarray(values[1:], dtype='float32')
        embeddings_index[word] = coefs
    f.close()
    print ('----------------')
    print('Found %s word vectors.' % len(embeddings_index))
    return embeddings_index

def read_pre_trained_ICD9_dic(ie):
    '''
        A funcion for converting an embedding and return a dictionary
    '''

    print ('Loading Pretrained embedding into dictionary')
    print ('*******************************')
    embeddings_index = {}

    #we have to run it only once to save the model as txt file, Next time we only provide the txt location
    #model_name_txt = create_txt_from_bin(model_name)
    #sys.exit()
    #model_name_txt = '/mnt/volume/data/embeddings/word2vec_twitter_model.bin_binary_false.txt'
    f = open(ie)
    #print f
    for line in tqdm(f):
        #print 'line--->',line
        #sys.exit()
        values = line.split()
        concept = values[0]
        if str(concept).startswith('IDX_'):
            coefs = np.asarray(values[1:], dtype='float32')
            concept = concept.replace('IDX_','ICD9CM:')
            embeddings_index[concept] = coefs
    f.close()
    print ('----------------')
    print('Found %s CUI vectors.' % len(embeddings_index))
    return embeddings_index

